['import java.util.*;
public class ProductOne580B {

	public static void main(String[] args) {
		Scanner s = new Scanner(System.in);
		int n = s.nextInt();
		int arr [] = new int[n];
		int neg = 0;
		int zero = 0;
		for(int i =0;i<n;i++) {
			arr[i]=s.nextInt();
			if(arr[i]<0) {
				neg++;
			}
			if(arr[i]==0) zero++;
			
		}
		long ans = 0;
		
		for(int p:arr) {
			if(p==0) {
				ans++;
			}else{
			ans+=Math.abs(p)-1;	
			}
		}
		
		if(neg%2!=0 && zero==0) {
			ans+=2;
		}
		System.out.println(ans);
	}

}
