long long binpow(int a, int  b, int m) {
    a %= m; 
    long long res = 1;
    while (b > 0) {
        if (b & 1)
            res = (res*a)% m;
        a = ((a%m)*(a%m))%m;
        b >>= 1;
    
    	
    }
    return res;
}


