    class Program
    {
        static void Main(string[] args)
        {
            int n = Convert.ToInt32(Console.ReadLine());
            string str = Console.ReadLine();
            int[] a = deleteSpace(str, n);
            a = sortArray(a);
            int m = Convert.ToInt32(Console.ReadLine());
            str = Console.ReadLine();
            int[] b = deleteSpace(str, m);
            b = sortArray(b);

            Console.Write(a[0]);
            Console.Write(" ");
            Console.Write(b[0]);
        }

        static int[] deleteSpace(string str, int arraySize)
        {
            int[] mas = new int[arraySize];
            int firstSpace = 0, secondSpace = 0, j = 0;

            for (int i = 0; i < str.Length; i++)
            {
                if (str[i] == ' ')
                {
                    secondSpace = i;
                    mas[j] = Convert.ToInt32(str.Substring(firstSpace, secondSpace - firstSpace));
                    j++;
                    firstSpace = secondSpace;
                }

                if (i == str.Length - 1)
                {
                    mas[mas.Length - 1] = Convert.ToInt32(str.Substring(secondSpace));
                }
            }

            return mas;
        }

        static int[] sortArray(int[] array)
        {
            int temp;

            for (int i = 0; i < array.Length - 1; i++)
            {
                for (int j = i + 1; j < array.Length; j++)
                {
                    if (array[i] < array[j])
                    {
                        temp = array[i];
                        array[i] = array[j];
                        array[j] = temp;
                    }
                }
            }

            return array;
        }
    }
}
