        int n = in.nextInt();
        long[] arr = new long[n];
        int neg = 0;
        int zero = 0;
        in.nextLine();
        for (int i = 0; i < n; i++) {
            arr[i] = in.nextInt();
            if (arr[i] < 0) {
                neg++;
            } else if (arr[i] == 0) {
                zero++;
            }
        }
        in.close();
        long res = 0;
        for (int i = 0; i < n; i++) {
            if (arr[i] >= 1) {
                res += (arr[i] - 1);
            }
            if (arr[i] < 0) {
                res += (-1 - arr[i]);
            }
        }
        if (neg % 2 == 1) {
            if (zero > 0) {
                res++;
                zero--;
            } else {
                res = res + 2;
            }
        }
        res = res + zero;
        System.out.println(res);
    }
}']

