['#include<iostream>
#include<vector>
#include<algorithm>
#include<queue>
#include<set>
#include<stack>
#include<string>
#include<map>
#define LL long long int
#define module 1000000007
using namespace std;

vector<vector<int>> graph;
vector<int> visited;

int BFS(int u, int v)
{
	for (int i = 0; i < visited.size(); i++)
		visited[i] = false;

	queue<int> Q;
	Q.push(u);
	int count = 0;
	visited[u] = true;
	int k = 0 ,pos = u;
	
	while (!Q.empty())
	{
		int pos = Q.front();
		count++;

		if (pos == v)
			break;

		Q.pop();
		for (int i = 0; i < graph.size(); i++)
		{
			if (graph[pos][i])
			{
				if (!visited[i])
				{
					visited[i] = true;
					Q.push(i);
				}
			}
		}
	}

	return count;
}



int main()
{
	ios_base::sync_with_stdio(false);
	cin.tie(NULL);
	cout.tie(NULL);
	



	int n;
	cin >> n;
	vector<LL> a;
	vector<int> count(62);
	bool ac = true;
	for (int i = 0; i < n && ac; i++)
	{
		LL ti;
		cin >> ti;

		if(ti != 0)
			a.push_back(ti);

		int j = 0;
		while (ti > 0 && ac)
		{
			if (ti & 1)
			{
				count[j]++;
				if (count[j] >= 3)
					ac = false;
			}
			j++;
			ti >>= 1;
		}
	}
	if (!ac)
		cout << 3 << endl;
	else
	{

		// Tao graph
		for (int i = 0; i < a.size(); i++)
		{
			vector<int> tv;
			graph.push_back(tv);
			visited.push_back(0);
			for (int j = 0; j < a.size(); j++)
			{
				graph[i].push_back(0);
			}
		}


		for (int i = 0; i < a.size(); i++)
		{
			for (int j = 0; j < a.size(); j++)
			{
				if (a[i] & a[j])
				{
					graph[i][j] = 1;
					graph[j][i] = 1;
				}
			}
		}
		/*
		for (int i = 0; i < graph.size(); i++)
		{
			cout << i << ": ";
			for (int j = 0; j < graph[i].size(); j++)
				cout << graph[i][j] << " ";

			cout << endl;
		}
		*/
		int min = module;
		for (int i = 0; i < a.size(); i++)
		{
			for (int j = 0; j < a.size(); j++)
			{
				if (graph[i][j])
				{
					graph[i][j] = 0;
					graph[j][i] = 0;

					int  t = BFS(i, j);

					graph[i][j] = 1;
					graph[j][i] = 1;

					if (t > 2 && t < min)
						min = t;
				}
			}
		}

		if (min == module)
			cout << -1 << endl;
		else
			cout << min << endl;

	}

//	system("pause");
	return 0;
}']

['#include <bits/stdc++.h>
#define cina(a, n) for (int i = 0; i < n; ++i){ cin >> a[i]; }
#define ll long long

using namespace std;

ll solve () {
	int n;
	ll c = 0;
	cin >> n;
	ll a[n];
	cina(a, n);
	map<ll, ll> mp;
	for (int i = 0; i < n; ++i) {
		if (a[i] > 1) {
			c += a[i] - 1;
			a[i] = 1;
		} else if (a[i] < -1) {
			c += -1 - a[i];
			a[i] = -1;
		}
		mp[a[i]]++;
	}
	if (mp[0] > 0) {
		if (mp[-1] % 2 == 1) {
			mp[-1]++;
			mp[0]--;
			c++;
		}
		mp[1] += mp[0];
		c += mp[0];
		mp[0] = 0;
	} else {
		if (mp[-1] % 2 == 1) {
			mp[1]--;
			mp[-1]++;
			c += 2;
		}
	}
	return c;
}

int main () {
	
	ios::sync_with_stdio(0);
	cin.tie(0);
	
	cout << solve();
	
	return 0;
}']

