['/**
    हमने तुम्हे जिस सिद्दत से चाहा वो हम जानते हैं,
    पड़ जिसकी तुम हो उसके मोहब्बत की ताकत क्या रही होगी.
**/
/**
	If some ith bit is 1 in at least three numbers, then they form a cycle of minimum length i.e. 3
	Else it is sure that ith bit is 1 in atmost two numbers. So at most there are 60 edges in graph.
**/

#include <bits/stdc++.h>

#define ll                   long long
#define MOD                  (ll)(1e9 + 7)
#define INF                  (ll)1e18
#define fast()               ios_base::sync_with_stdio(false);  cin.tie(NULL);
#define loop(i,a,b)          for(ll i=(ll)a;i<(ll)b;i++)
#define pool(i,a,b)          for(ll i=(ll)a;i>=(ll)b;i--)
#define pb                   push_back
#define vi                   vector<ll>
#define endl                 "\n"
#define param                greater<ll>()
#define ff                   first
#define ss                   second
#define all(v)               v.begin(),v.end()
#define dbg(x)               cout<<#x<<" is: "<<x<<endl;

using namespace std;

bool isvowel(char c){if(c=='a' || c=='e' || c=='i' || c=='o' || c=='u' || c=='A' || c=='E' || c=='I' || c=='O' || c=='U')return true;return false;}

ll fast_exp(ll x,ll n){ll ans=1;while(n){if(n&1)ans*=x;n=n>>1;x=x*x;}return ans;}

ll mod_exp(ll x, ll y,ll p){ll res = 1;x = x % p;while(y>0){if(y&1)res = (res*x) % p;y = y>>1;x=(x*x)%p;}return res;}

ll sod(ll n){ll sum = 0;    while(n!=0){sum=sum+(n%10);n=n/10;}     return sum;}

ll modInverse(ll a, ll m){  return mod_exp(a, m-2, m);} 

ll nCrModpDP(ll n,ll r,ll p) 
{
    ll C[r+1]; 
    memset(C,0,sizeof(C)); 
    C[0]=1;
    for(ll i=1;i<=n;i++) 
    { 
        for (ll j=min(i,r);j>0;j--) 
            C[j]=(C[j]+C[j-1])%p; 
    } 
    return C[r]; 
} 
 
ll nCrModpLucas(ll n,ll r,ll p) 
{
    if(r==0) 
        return 1; 
    ll ni=n%p,ri=r%p; 
    return(nCrModpLucas(n/p,r/p,p)*nCrModpDP(ni,ri,p))%p;

    //O(p2 * logp(n)) 
} 

/*End of template */
vector<ll> vec[61];

const ll MAX = 1e5 + 10;
int dis[MAX],par[MAX];
bool vis[MAX];

void solve()
{
    ll n;
    cin >> n;

    vector<ll> a(n);

    loop(i,0,n)		cin >> a[i];

    loop(i,0,n)
    {
    	if(a[i]>0)
    	{
   			for(ll x = 1; x<=60; x++)
    		{
    			if((a[i] & (fast_exp(2LL,x-1))))	// Check if xth bit is set
        			vec[x].pb(i);
    		}    		
    	}
    }

    for(ll x=1; x<=60; x++)
    {
    	if(vec[x].size()>=3)
    	{
    		cout << "3";
    		return;
    	}
    }

    //??

    ll ans = n+2,x;
  	for(ll i = 0; i<n; i++)
  	{
    	if(a[i]>0)
    	{
      		memset(dis,-1LL,sizeof(dis));
      		memset(par,-1LL,sizeof(par));
      		memset(vis,0,sizeof(vis));
      
      		queue<ll>nodes;
      		nodes.push(i);
      		dis[i] = 0;
      		while(!nodes.empty())
      		{
        		x = nodes.front();
        		vis[x] =1;
        		nodes.pop();
        		for (ll j = 1; j <=60 ; ++j)
        		{
         			if((fast_exp(2LL,j-1)) & a[x])
         			{
          				for(auto it : vec[j])
          				{
            				if(it==par[x] or x==it)
            					continue;
            				if(!vis[it])
            				{
              					par[it] = x;
              					nodes.push(it);
              					dis[it] =dis[x]+1;
            				}
            				else
              					ans = min(ans,dis[x]+dis[it]+1LL);
          				}
         			}
        		}
      		} 
    	}
  	}
 
 	if(ans==n+2)
 		ans = -1;  
 	
 	cout<<ans<<"\n";

 	// ??

}

