	bool zeroCounter = false;
	int n, step = 0, multiply = 1;
	cin >> n;
	while(n--) {
		int num;
		cin >> num;
		
		if (num > 0) {
			multiply *= 1;
		} else if (num < 0) {
			multiply *= -1;
		}
		
		if (num != 0) {
			step += abs(num) - 1;
		} else {
			zeroCounter = true;
			step++;
		}
	}
	
	if (multiply == -1 && !zeroCounter) {
		step += 2;
	} 
	
	cout << step;
}
