 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        Scanner in = new Scanner(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        DShortestCycle solver = new DShortestCycle();
        solver.solve(1, in, out);
        out.close();
    }

    static class DShortestCycle {
        static ArrayList<Integer>[] adj;

        public void solve(int testNumber, Scanner sc, PrintWriter pw) {
            int n = sc.nextInt();
            long[] tmpp = new long[n];
            TreeSet<Long> ts = new TreeSet<>();
            for (int i = 0; i < n; i++) {
                tmpp[i] = sc.nextLong();
                ts.add(tmpp[i]);
            }
            long[] arr = new long[n];
            int idx = 0;
            for (Long x : ts) {
                arr[idx++] = x;
            }
            if (ts.size() > 2016) {
                pw.println(3);
            } else {
                for (int j = 0; j < 64; j++) {
                    int c = 0;
                    for (long x : arr)
                        if ((x & (1L << j)) > 0)
                            c++;
                    if (c >= 3) {
                        pw.println(3);
                        return;
                    }
                }
                adj = new ArrayList[n];
                for (int i = 0; i < n; i++)
                    adj[i] = new ArrayList<>();
                for (int j = 0; j < 64; j++) {
                    ArrayList<Integer> tmp = new ArrayList<Integer>();
                    for (int i = 0; i < n; i++) {
                        long x = arr[i];
                        if ((x & (1L << j)) > 0)
                            tmp.add(i);
                    }
                    if (tmp.size() > 1) {
                        int a = (int) tmp.get(0);
                        int b = (int) tmp.get(1);
                        adj[a].add(b);
                        adj[b].add(a);
                    }
                }

                //    pw.println(Arrays.toString(adj));
                pw.println(shortest_cycle(n));
            }
        }

        static int shortest_cycle(int n) {

            // To store length of the shortest cycle
            int ans = Integer.MAX_VALUE;

            // For all vertices
            for (int i = 0; i < n; i++) {

                // Make distance maximum
                int[] dist = new int[n];
                Arrays.fill(dist, (int) 1e9);

                // Take a imaginary parent
                int[] par = new int[n];
                Arrays.fill(par, -1);

                // Distance of source to source is 0
                dist[i] = 0;
                Queue<Integer> q = new LinkedList<>();

                // Push the source element
                q.add(i);

                // Continue until queue is not empty
                loop:
                while (!q.isEmpty()) {

                    // Take the first element
                    int x = q.poll();

                    // Traverse for all it's childs
                    for (int child : adj[x]) {
                        // If it is not visited yet
                        if (dist[child] == (int) (1e9)) {

                            // Increase distance by 1
                            dist[child] = 1 + dist[x];

                            // Change parent
                            par[child] = x;

                            // Push into the queue
                            q.add(child);
                        } else if (par[x] != child && par[child] != x) {
                            ans = Math.min(ans, dist[x] + dist[child] + 1);
                            break loop;
                        }
                    }
                }
            }

            // If graph contains no cycle
            if (ans == Integer.MAX_VALUE)
                return -1;

                // If graph contains cycle
            else
                return ans;
        }

    }

