                        // Change parent 
                        par[child] = x; 
  
                        // Push into the queue 
                        q.add(child); 
                    } else if (par[x] != child && par[child] != x) 
                        ans = Math.min(ans, dist[x] + dist[child] + 1); 
                } 
            } 
        } 
  
        // If graph contains no cycle 
        if (ans == Integer.MAX_VALUE) 
            return -1; 
  
        // If graph contains cycle 
        else
            return ans; 
    } 
  
