	public static long ncr(int n , int r ) {
		if(n<r) return 0;
		long ans=fac[n];
		ans=(ans*powmod(fac[n-r], mod-2, mod))%mod;
		ans=(ans*powmod(fac[r], mod-2, mod))%mod;
		return ans;
	}
	static int log(long n, long r) 
	{ 
	    return (n > r - 1) ? 1 + log(n / r, r) : 0; 
	} 
	 
	 
	public static long powmod(long x ,int p,int mod) {// loop O(log p )
		long ans=1;
		x%=mod;
		while(p>0) {
			
			if((p&1)==1) 
				ans= (ans*x)%mod;
		x=(x*x)%mod;
		p>>=1;
		}
		return ans;
	}
