void Selectionsort(int a[],int n){
	for(int i=0;i<n-1;i++){
		int min=i;
		for(int j=i+1;j<n;j++){
			if(a[j]<a[min])
				min=j;
		}
		int tmp=a[i];
		a[i]=a[min];
		a[min]=tmp;
	}
}

int Binarysearch(int a[],int n,int x){
	int left=0;
	int right=n-1;
	while(left<=right){
		int mid=left+(right-left)/2;
		if(x==a[mid])
			return 1;
		else if(x>a[mid])
			left=mid+1;
		else
			right=mid-1;
	}
	return 0;
}
