	int left=0;
	int right=n-1;
	while(left<=right){
		int mid=left+(right-left)/2;
		if(x==a[mid])
			return 1;
		else if(x>a[mid])
			left=mid+1;
		else
			right=mid-1;
	}
	return 0;
}
