int n;
long long a[100001];
vector <int> bit[70];
vector <int> e[100001];
int d[100001];
set <int> se;
int ans = INT_MAX;
void bfs(int s,int t)
{
    queue <int> q;
    q.push(s);
    for(auto v:se)
    {
        d[v]=-1;
    }
    d[s] = 1;
    while(!q.empty())
    {
        int u = q.front();
        q.pop();
        for(auto v:e[u])
        {
            if(u==s&&v==t||v==s&&u==t)
                continue;
            if(d[v]==-1)
            {
                d[v] = d[u]+1;
                q.push(v);
            }
            if(v==t)
            {
                ans=min(ans,d[v]);
                return;
            }
        }
    }
}
int main()
{
    cin>>n;
    for(int i=1;i<=n;i++)
    {
        cin>>a[i];
        for(int j=0;j<=60;j++)
        {
            if(a[i]&(1LL<<j))
            {
                bit[j].push_back(i);
            }
            if(bit[j].size()>=3)
            {
                cout<<3;
                return 0;
            }
        }
    }
    for(int i = 0;i<=60;i++)
    {
        if(bit[i].size()<=1)
            continue;
        int u = bit[i][0];
        int v = bit[i][1];
        e[u].push_back(v);
        e[v].push_back(u);
        se.insert(u);
        se.insert(v);
    }
    for(auto s : se)
    {
        for(auto v : e[s])
        {
            bfs(s,v);
        }
    }
    if(ans==INT_MAX)
        ans=-1;
    cout<<ans;
    return 0;
}
