["#include <bits/stdc++.h>
using namespace std;
#define ll long long  
#define pb push_back
#define mp make_pair
#define f first
#define s second
#define all(x) x.begin(),x.end()
#define LOL cout<<'\n';
#define N 100200 

vector<ll> gr[N]; 
  
// Function to add edge 
void Add_edge(ll x,ll y) 
{ 
    gr[x].push_back(y); 
    gr[y].push_back(x); 
} 
  
// Function to find the length of 
// the shortest cycle in the graph 
ll shortest_cycle(ll n) 
{ 
    // To store length of the shortest cycle 
    ll ans = INT_MAX; 
  
    // For all vertices 
    for (ll i = 0; i < n; i++) { 
  
        // Make distance maximum 
        vector<ll> dist(n, (ll)(1e9)); 
  
        // Take a imaginary parent 
        vector<ll> par(n, -1); 
  
        // Distance of source to source is 0 
        dist[i] = 0; 
        queue<ll> q; 
  
        // Push the source element 
        q.push(i); 
  
        // Continue until queue is not empty 
        while (!q.empty()) { 
  
            // Take the first element 
            ll x = q.front(); 
            q.pop(); 
  
            // Traverse for all it's childs 
            for (ll child : gr[x]) { 
  
                // If it is not visited yet 
                if (dist[child] == (ll)(1e9)) { 
  
                    // Increase distance by 1 
                    dist[child] = 1 + dist[x]; 
  
                    // Change parent 
                    par[child] = x; 
  
                    // Push into the queue 
                    q.push(child); 
                } 
  
                // If it is already visited 
                else if (par[x] != child and par[child] != x) 
                    ans = min(ans, dist[x] + dist[child] + 1); 
            } 
        } 
    } 
  
    // If graph contains no cycle 
    if (ans == INT_MAX) 
        return -1; 
  
    // If graph contains cycle 
    else
        return ans; 
}


int main() {
  ios_base::sync_with_stdio(0);
  cin.tie(0); cout.tie(0);
  ll n,s=0; cin>>n;
  ll a[n],ans=0;
  vector<ll> v[100];
  for(ll i=0 ; i<n ; i++) cin>>a[i];
  for(ll i=0 ; i<n ; i++){
  	s=0;
  	ans=i;  	
    while(a[i]>0){
        if(a[i]%2) v[s].pb(ans);
  		a[i]/=2;
  		s++;
  	}
  }
  for(ll i=0 ; i<100 ; i++){
    if(v[i].size()>=3){
          cout<<3;
          return 0;
    }
  	for(ll j=0 ; j<(ll)(v[i].size()-1) ; j++){
         Add_edge(v[i][j],v[i][j+1]); 
  	}
  }
    cout<<shortest_cycle(n); 
  return 0;
}
