int xoro(int n)
 
{
    int mod = n % 4; 
    if (mod == 0) 
        return n; 
    else if (mod == 1) 
        return 1; 
    else if (mod == 2) 
        return n + 1; 
    else if (mod == 3) 
        return 0;
}
 
int lolbhai(int n, int r) 
{ 
    long long p = 1, k = 1; 
    if (n - r < r) 
        r = n - r; 
    if (r != 0) { 
        while (r) { 
            p *= n; 
            k *= r; 
            long long m = __gcd(p, k); 
            p /= m; 
            k /= m; 
            n--; 
            r--; 
        } 
    } 
  
    else
        p = 1; 
    
    return p;
}
 
 
int MaxSubArraySumReturn(int a[],int  n)   //negative thakle o kaaj korbe in O(n)
{
    
    int sum=0,best=0;
    f0(i,n)
    {
        sum=max(a[i],a[i]+sum);
        best=max(best,sum);
    }
    return best;
 
}
 
 
int hello(int a,int b)
{
    return (xoro(a-1)^xoro(b));
}
 
 
int fact(int n) 
{ 
    int res = 1; 
    for (int i = 2; i <= n; i++) 
        res = res * i; 
    return res; 
} 
 
  
int nCr(int n, int r) 
{ 
    return fact(n) / (fact(r) * fact(n - r)); 
} 
  
bool sortinrev(const pair<int,int> &a,  
               const pair<int,int> &b) 
{ 
       return (a.first > b.first); 
} 
  
 
 
