vl adjList[100005];
int weight[100005];
bool vis[100005];
ll ans;
void bfs(int x,int cur){
	queue<int>q;
	q.push(x);
	weight[x]=0;
	vis[x]=1;
	while(!q.empty()){
		int top=q.front();
		q.pop();
		for(auto it:adjList[top]){
			if(!vis[it]){
				vis[it]=1;
				q.push(it);
				weight[it]=weight[top]+1;
			}else{
				if(it!=cur){
					// cout<<x<<"__"<<
					ans=min(ans,(ll)1+weight[it]+weight[top]);
				}
			}

		}
	}
}

