ll fun(ll arr[],ll s,ll e)
{
    if(s==e) return 1;
    ll a=1;
    for(int i=s+1;i<=e;i++ )
    {
        if(arr[i]>=arr[i-1]) a++;
        else break;
    }
    if(a==e-s+1) return a;
    
    a=max(fun(arr,s,s+(e-s)/2),fun(arr,s+(e-s)/2+1,e));
    return a;
    
}

