['#include <bits/stdc++.h>
using namespace std;
#define LL long long
#define pb push_back

vector < LL > V[65];
map < LL , vector < LL > > E;
map < LL , int > Depth;
set < LL > S;

int opt = 1e9;
int n;
LL A[100005];

void dfs( LL u, LL par, int dep ){
	if ( Depth[u] != -1 ) return;
	Depth[u] = dep;
	for ( LL v : E[u] ){
		if ( v == par ) continue;
		if ( Depth[v] == -1 ){
			dfs(v,u,dep+1);
		} else {
			int len = dep - Depth[v] + 1;
			if ( len < opt ) opt = len;
		}
	}
	Depth[u] = -1;
}

int main(){
	
	scanf("%d",&n);
	for ( int i = 1; i <= n; i++ ){
		scanf("%lld",&A[i]);
		for ( int j = 0; j < 60; j++ ){
			if ( (A[i]>>j) & 1LL ){
				V[j].pb(A[i]);
			}
		}
	}
	
	for ( int i = 0; i < 60; i++ ){
		if ( V[i].size() > 2 ){
			printf("3\n");
			return 0;
		}
	}
	
	for ( int i = 0; i < 60; i++ ){
		if ( V[i].size() == 2 ){
			E[V[i][0]].pb(V[i][1]);
			E[V[i][1]].pb(V[i][0]);
			S.insert(V[i][0]);
			S.insert(V[i][1]);
		}
	}
	
	for ( auto v : S ) Depth[v] = -1;
	
	if ( !S.empty() ) dfs(*S.begin(),-1,0);
	
	if ( opt == 1e9 ) printf("-1\n");
	else printf("%d\n",opt);
	return 0;
}
