['#include <bits/stdc++.h>
#define ll long long
#define ull long long
using namespace std;
struct hren{
	int a;
	int b;
};
void Heap(int A[],int n,int l,int r)
{
	int x,i,j;
	x=A[l];
	i=l;
	while(1)
	{
		j=2*i;
		if(j>r)break;
		if(j<r&&A[j+1]>=A[j])
		j++;
		if(x>=A[j]) break;
		A[i]=A[j];
		i=j;
	}
	A[i]=x;
}
void HeapSort(int A[],int n)
{
	int l,r,temp;
	l=n/2;
	while(l>=0)
	{
		Heap(A,n,l,n-1);
		l--;
	}
	r=n-1;
	while(r>=1)
	{
		temp=A[0];
		A[0]=A[r];
		A[r]=temp;
		r--;
		Heap(A,n,0,r);
	}
}
int main()
{
    int n,m;
    cin>>n;
    int mas[n];
    for(int i=0;i<n;i++){
        cin>>mas[i];
    }
    cin>>m;
    int mas1[m];
    for(int i=0; i<m;i++){
        cin>>mas1[i];
    }
    sort(mas,mas+n);
    sort(mas1,mas1+m);
    cout<<mas[n-1]<<" "<<mas1[m-1];
}']

