        for (int i = 0 ; i < n; i++) {
            arr[i] = scanner.nextLong();
            if (arr[i] < 0) minuses++;
            if (arr[i] < -1) res += -1 - arr[i];
            else if (arr[i] > 1) res += arr[i] - 1;
            else if (arr[i] == 0) {
                zero = true;
                res++;
            }
        }

        System.out.println(minuses % 2 == 0 ? res : zero ? res + 1 : res + 2);
    }

}

