	cin>>n;
	mn = 1e9+7;
	memset(vis, 0 ,sizeof(vis));
	for(lli i=0;i<n;i++) cin>>a[i];
	int f=0;
	for(lli i=0;i<64;i++){
		for(lli j=0;j<n;j++){
