		}
		if(adj[i].size()>2) f=1;
	}
	if(f) {
		cout<<"3"<<endl;
		return ;
	}
	for(lli i=0;i<n;i++){
		memset(vis, 0 ,sizeof(vis));
		if(!vis[i]) dfs(i,1);
	}
