['#include <bits/stdc++.h> 
using namespace std;

string bi(long long num){
    string ret = "";
    while(num){
        if(num&1){
            ret +='1';
        }else
            ret+='0';
        num/=2;
    }
    for(int i = (int)ret.size() ; i<=64 ; i++){
        ret+='0';
    }
    reverse(ret.begin() , ret.end());
    return ret;
}
vector<vector<int>>vi(105);
vector<string>vs;
vector<vector<int>>bb(100005);
int arr[66];
int shortest_cycle_from(int node){
    queue<pair<int,int>>q;
    q.push({node,-1});
    while(q.size()){
        int curr = q.front().first , par = q.front().second;
        q.pop();
        for(auto it : vi[curr]){
            if(it==par)continue;
            if(it == node)
                return arr[curr] + 1; 
            if(arr[it])continue;
            arr[it] = arr[curr] + 1;
            q.push({it,curr});
            break;
        }
    }
    return -1;
}
int main() 
{ 
    int n ;
    cin>>n;
    bool ok = false;
    for(int i = 0; i <n ; i++){
        long long x;cin>>x;
        vs.push_back(bi(x));
        for(int j = 0; j<(int)vs[i].size()  ;j++ ){
            if(vs[i][j] == '1'){
                bb[j].push_back(i);
                if((int)bb[i].size() >= 3){
                    ok = true;
                }
            }
        }
    }
    if(ok)return cout<<3,0;
    for(int i= 0 ; i < 65; i++){
        if((int)bb[i].size() == 2){
            int u = bb[i][0];
            int v = bb[i][1];
            vi[u].push_back(v);
            vi[v].push_back(u);
        }
    }
    int ans = -1;
    for(int i = 0 ; i < 65 ; i++){
        memset(arr,0,sizeof(arr));
        ans = max(ans , shortest_cycle_from(i));
    }
    cout<<ans;
    return 0;
} 
