#define fastio ios_base::sync_with_stdio(false);cin.tie(NULL);cout.tie(NULL)
using namespace std;
lli powm(lli a,lli b ,lli mod){if(b==0) return 1;if(b%2==0){ lli tmp = powm(a,b/2,mod); return (tmp*tmp)%mod;}else return (a%mod * powm(a,b-1,mod))%mod;}
lli invm(lli a, lli mod) {return powm(a,mod-2,mod); } //fermats's method // mod has to be a prime

lli a[100005];
vector<lli> adj[64];
lli mn;
lli vis[100005];

void dfs(lli i,lli ctr){
	if(vis[i]==0){
		vis[i] = ctr;
		for(lli ii=0;ii<64;ii++){
			if(a[i] & (1LL << ii)){
				for(lli u:adj[ii]){
					if(u!=i) dfs(u,ctr+1);
				}
			}
		}
	}
	else if(ctr - vis[i] > 2){
		mn = min(mn,ctr-vis[i]);
	}
}

inline void solve(){
	lli n;
	cin>>n;
	mn = 1e9+7;
	memset(vis, 0 ,sizeof(vis));
	for(lli i=0;i<n;i++) cin>>a[i];
	for(lli i=0;i<64;i++){
		for(lli j=0;j<n;j++){
			if(a[j] & (1LL << i)) adj[i].push_back(j);
		}
	}
	for(lli i=0;i<n;i++){
		if(!vis[i]) dfs(i,1);
	}
	cout<<(mn==(1e9+7) ? -1 : mn)<<endl;
}

int main(){
	fastio;lli  t=1,tc=1;
	//cin>>t;
	while(t--){solve();}return 0;
