//http://codeforces.com/problemset/problem/1206/B

int main(){
	int n;
	cin>>n;
	vector<long long> arr(n);
	
	long long count_pos=0, count_neg=0, biggest_neg=INT32_MIN, smallest_pos=INT32_MAX;
	bool already_possible=true;
	for(int i=0;i<n;i++){
		cin>>arr[i];
		if(arr[i]!=1 and arr[i]!=-1) already_possible = false;
		if(arr[i]>=0){
			smallest_pos = min(smallest_pos, arr[i]);
			count_pos++;
		}
		else{
			biggest_neg = max(biggest_neg, arr[i]);
			count_neg++;
		}
	}
	
	if(already_possible and count_neg%2==0){
		cout<<0;
		return 0;
	}
	long long min_steps=0;
	if(count_neg%2==0)
		for(int i=0;i<n;i++)
			min_steps += abs(abs(arr[i])-1);
	
	else{
		bool flip=false;
		int flip_val = min(abs(biggest_neg), smallest_pos);
		for(int i=0;i<n;i++){
			if(!flip and abs(arr[i]) == flip_val){
				min_steps += abs(arr[i]) + 1;
				flip = true;
			}
			else min_steps += abs(abs(arr[i])-1);
		}
	}
	
	cout<<min_steps<<"\n";
	return 0;
}
