            v[i].pb(k % 2LL);
            k /= 2LL;
        }
    }

    for(i = 0; i < n; i++){
        for(j = 0; j < 64; j++){
            cnt[j] += v[i][j];
            if(v[i][j]){
                mp[j].pb(i);
            }
        }
    }

    for(auto i : cnt){
        if(i >= 3){
            cout << 3 << endc;
