['#include<bits/stdc++.h>
using namespace std;
#define ll long long int
int main()
{
	ll N[100010]={0};
	ll P[100010]={0};
	ll n;
	scanf("%lld",&n);
	ll negc=0,posc=0,zeroc=0;
	ll sumneg=0,sumpos=0;
	ll maxneg=-10000000000;
	ll i,a,ans=0;
	for(i=0;i<n;i++)
	{
		scanf("%lld",&a);
		if(a<0)
		{
			N[negc++]=a;
			sumneg+=a;
			if(a>maxneg)
			maxneg=a;
		}
		else if(a>0)
		{
			P[posc++]=a;
			sumpos+=a;
		}
		else
		zeroc++;
	}
	if((negc%2)==0)
	{
		sumneg=(-1)*sumneg;
		ans=sumneg-negc+sumpos-posc+zeroc;
	}
	else
	{
		sumneg=sumneg-maxneg;
		sumneg=(-1)*sumneg;
		ans=sumneg-(negc-1)+sumpos-posc+zeroc+(1-maxneg);
	}
	printf("%lld",ans);
	return 0;
}']

