['import java.io.*;
import java.util.*;

public class Solution {
    public static void main (String[] args) throws IOException {
        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
        int size = Integer.parseInt(reader.readLine().trim());
        String[] str = reader.readLine().trim().split(" ");
        int[] arr = new int[size];
        int negative = 0;
        for (int i = 0; i < size; i++) {
            arr[i] = Integer.parseInt(str[i]);
            if (arr[i] < 0) {
                negative++;
            }
        }
        Arrays.sort(arr);
        if (negative == 0) {
            long operations = 0;
            for (int i = 0; i < size; i++) {
                operations += Math.abs(arr[i] - 1);
            }
            System.out.println(operations);
            return;
        }
        int positive = size - negative;
        long operations = 0;
        int m = Math.abs(arr[negative - 1] + 1) + Math.abs(arr[negative] + 1);
        int p = Math.abs(arr[negative - 1] - 1) + Math.abs(arr[negative] - 1);
        if (m > p) {
            operations += p;
        } else {
            operations += m;
        }
        for (int i = 0; i < negative - 1; i++) {
            operations += Math.abs(-arr[i] - 1);
        }
        for (int i = negative + 1; i < size; i++) {
            operations += Math.abs(arr[i] - 1);
        }
        System.out.println(operations);
        
        reader.close();
    }
    
    

}




