['#include <iostream>
#include <vector>
#include <map>
#include <queue>
#include <utility>
#include <set>
#define ll long long int
#define ii pair < ll, ll >
#define mp make_pair
#define F first
#define S second
 
using namespace std;
 
map < ll, set < ll > > g;
set < ll >:: iterator it;
map < ll, ll > d;
 
ll bfs(ll rt){
	d.clear();
	queue < ii > q;
	d[rt] = 1;
	q.push( mp(rt, -1) );
	ll res = 100000000000LL;
	while( !q.empty() ){
		ll u = q.front().F;
		ll nd = q.front().S;
		q.pop();
		for( it = g[u].begin(); it != g[u].end() ; it++){
			ll v = (*it);
			if(v == nd) continue;
			if(d.find(v) != d.end() && d[u] + d[v] > 3){
				res = min(res, d[u] + d[v] - 1LL);
			}
			if(d.find(v) == d.end()){
				d[v] = d[u] + 1;
				q.push( mp(v, u) );
			}
		}
	}
	return res;
}
 
int main(){
	vector < ll > v[61];
	ll n, a;
	cin >> n;
	for(int i = 0 ; i < n ; i++){
		cin >> a;
		for(int j = 0 ; (1LL<<j) <= 1000000000000000000LL ; j++){
			if( ((1LL<<j)&a) != 0) v[j].push_back(i);
		}
	}
	for(int i = 0 ; i < 61 ; i++){
		if(v[i].size() > 2){
			cout << 3;
			return 0;
		}if(v[i].size() == 2){
			g[v[i][0]].insert(v[i][1]);
			g[v[i][1]].insert(v[i][0]);
		}
	}
	ll ans = 100000000000LL;
	map < ll, set < ll > > :: iterator it1;
	/*
	for(it1 = g.begin(); it1 != g.end() ; it1++){
		ll j = it1->first;
		cout << j << " : ";
		for( it = g[j].begin(); it != g[j].end() ; it++){
			cout << (*it) << ' ';
		}
		cout << endl;
	}*/
	for(it1 = g.begin(); it1 != g.end() ; it1++){
		ans = min(ans, bfs(it1->first));
	}
	if(ans == 100000000000LL) cout << -1;
	else cout << ans;
	return 0;
}
 
 
