using namespace std; 
typedef long long ll;
int main() 
{
    ll n; cin >> n; 
    vector<ll> nums; 
    for (ll i = 0; i < n; ++i) 
    {
        ll a; 
        cin >> a; 
        nums.push_back(a);
    }

    ll cost = 0; 
    bool zeroExist = false;
    for (ll& num: nums) 
    {
        if (num == 0) 
        {
            ++cost;
            num = 1; 
            zeroExist = true; 
        }
        else if (num < 0)
        {
            cost += abs(num) - 1; 
            num = -1;
        }
        else 
        {
            cost += abs(num) - 1;    
            num = 1; 
        }
        
    }
    ll prod = 1; 
    for (ll& num: nums) 
    {
        prod *= num; 
    }
    


    if (prod == 1) 
    {
        cout << cost << endl; 
        return 0;
    }

    if (zeroExist == false) cost += 2; 
    
    cout << cost << endl; 

    return 0;
}']

