['#include <bits/stdc++.h>

using namespace std;

#define pb push_back
#define mp make_pair
#define fi first
#define se second
#define debug(x) cout << x << "\n";
#define debug_(x) cout << x << " ";

bool comp(int a, int b) {
	return abs(a) < abs(b);
}

int main() {
	ios_base::sync_with_stdio(false);
	cin.tie(NULL);

	int n;
	cin >> n;

	vector<int> arr;
	arr.resize(n);
	for(int i = 0; i < n; i++)
		cin >> arr[i];

	int counter = 0;

	for(int k : arr)
		if(k < 0)
			counter++;

	int coin = 0;

	if(not (counter % 2 == 0)) {
		auto e = min_element(arr.begin(), arr.end(), comp);
		if(*e < 0) {
			coin += -*e + 1;
			*e   += -*e + 1;
		}
		else if(*e > 0) {
			coin += *e + 1;
			*e   += *e + 1;
		}
		else {
			*e++;
			coin++;
		}
	}

	for(int& i : arr) {
		if(i < -1) {
			coin += abs(i) - 1;
		}
		else if(i > 1) {
			coin += i - 1;
		} else if(i == 0)
			coin++;
	}

	cout << coin << "\n";
    return 0;
}
