		PrintWriter out= new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		
		int n=Integer.parseInt(in.readLine());
		int sum=0;
		int aux;
		int negativos=0;
		StringTokenizer st=new StringTokenizer(in.readLine());
		for(int i=0;i<n;i++) {
			aux=Integer.parseInt(st.nextToken());
			if(aux==0)
				sum+=1;
			else {
				if(aux>1)
					sum+=(aux-1);
				else if(aux<0) {
					if(aux==-1);
					else
						sum+=Math.abs(aux)-1;
					negativos++;
				}
			}
				
		}
		if(negativos%2==0)
			out.append(sum+"\n");
		else
			out.append((sum+2)+"\n");
		out.flush();
		in.close();
		out.close();
	}
}     
