['#include <iostream>
#include <vector>
#include <map>
#include <queue>
#define ll long long int

using namespace std;

map < ll, vector < ll > > g;
map < ll, ll > d;

ll bfs(ll rt){
	d.clear();
	queue < ll > q;
	d[rt] = 0;
	q.push(rt);
	ll res = 100000000000LL;
	while( !q.empty() ){
		ll u = q.front();
		q.pop();
		for(int i = 0 ; i < g[u].size() ; i++){
			ll v = g[u][i];
			if(d.find(v) != d.end() && d[u] + d[v] > 2){
				res = min(res, d[u] + d[v] + 1LL);
			}
			if(d.find(v) == d.end()){
				d[v] = d[u] + 1;
				q.push(v);
			}
		}
	}
	return res;
}

int main(){
	vector < ll > v[61];
	ll n, a;
	cin >> n;
	for(int i = 0 ; i < n ; i++){
		cin >> a;
		for(int j = 0 ; (1LL<<j) <= 1000000000000000000LL ; j++){
			if( ((1LL<<j)&a) != 0) v[j].push_back(i);
		}
	}
	for(int i = 0 ; i < 61 ; i++){
		if(v[i].size() > 2){
			cout << 3;
			return 0;
		}if(v[i].size() == 2){
			g[v[i][0]].push_back(v[i][1]);
			g[v[i][1]].push_back(v[i][0]);
		}
	}
	ll ans = 100000000000LL;
	map < ll, vector < ll > > :: iterator it;
	for(it = g.begin(); it != g.end() ; it++){
		ans = min(ans, bfs(it->first));
	}
	if(ans == 100000000000LL) cout << -1;
	else cout << ans;
	return 0;
}



