['#include <iostream>
#include <vector>
#include <map>
#include <queue>
#include <utility>
#define ll long long int
#define ii pair < ll, ll >
#define mp make_pair
#define F first
#define S second
 
using namespace std;
 
map < ll, vector < ll > > g;
map < ll, ll > d;
 
ll bfs(ll rt){
	d.clear();
	queue < ii > q;
	d[rt] = 1;
	q.push( mp(rt, -1) );
	ll res = 100000000000LL;
	while( !q.empty() ){
		ll u = q.front().F;
		ll nd = q.front().S;
		q.pop();
		for(int i = 0 ; i < g[u].size() ; i++){
			ll v = g[u][i];
			if(v == nd) continue;
			if(d.find(v) != d.end() && d[u] + d[v] > 3){
				res = min(res, d[u] + d[v] - 1LL);
			}
			if(d.find(v) == d.end()){
				d[v] = d[u] + 1;
				q.push( mp(v, u) );
			}
		}
	}
	return res;
}
 
int main(){
	vector < ll > v[61];
	ll n, a;
	cin >> n;
	for(int i = 0 ; i < n ; i++){
		cin >> a;
		for(int j = 0 ; (1LL<<j) <= 1000000000000000000LL ; j++){
			if( ((1LL<<j)&a) != 0) v[j].push_back(i);
		}
	}
	for(int i = 0 ; i < 61 ; i++){
		if(v[i].size() > 2){
			cout << 3;
			return 0;
		}if(v[i].size() == 2){
			g[v[i][0]].push_back(v[i][1]);
			g[v[i][1]].push_back(v[i][0]);
		}
	}
	ll ans = 100000000000LL;
	map < ll, vector < ll > > :: iterator it;
	/*
	for(it = g.begin(); it != g.end() ; it++){
		ll j = it->first;
		cout << j << " : ";
		for(int k = 0 ; k < g[j].size() ; k++){
			cout << g[j][k] << ' ';
		}
		cout << endl;
	}*/
	for(it = g.begin(); it != g.end() ; it++){
		ans = min(ans, bfs(it->first));
	}
	if(ans == 100000000000LL) cout << -1;
	else cout << ans;
	return 0;
}
 
 
