typedef long long int LL;

int main(){
    ios_base:: sync_with_stdio(false);
    cin.tie(NULL);
    cout.tie(NULL);
    
    LL n,x, zero=0;
    cin>>n;
    vector<LL> pos, neg;
    for(int i=0; i<n; i++){
        cin>>x;
        if(x>0){
            pos.push_back(x);
        }
        else if(x<0){
            neg.push_back(x);
        }
        else{
            zero++;
        }
    }
    LL ans=0;
    for(LL i=0; i<pos.size(); i++){
        ans= ans+ abs(pos[i]-1);
    }
    if(neg.size()%2==0){
        for(LL i=0; i<neg.size(); i++){
            ans = ans+ abs(neg[i]+1);
        }
        ans = ans+zero;
    }
    else{
        if(zero>=1){
            for(LL i=0; i<neg.size(); i++){
                ans= ans+ abs(neg[i]+1);
            }
            ans = ans+ zero-1;
        }
        else{
            for(LL i=0; i<neg.size()-1; i++){
                ans= ans+ abs(neg[i]+1);
            }
            ans = ans+ abs(neg[neg.size()-1]-1);
        }
    }
    cout<<ans<<endl;
    return 0;
}']

['#include <bits/stdc++.h>

using namespace std;

int main() {
    int n; scanf("%d", &n);
    
    int coins = 0, zero = 0;
    bool pos = true;

    for (int i = 0; i < n; i++) {
        int a; scanf("%d", &a);

        if (a < 0) coins += -1 - a, pos = !pos;
        else if (a > 0) coins += a - 1;
        else zero++;
    }

    if (zero > 0) coins += zero;
    else if (!pos) coins += 2;

    printf("%d\n", coins);
}']

