    long maximum=-1000000000,minimum=1000000000;
    for(int i=0;i<n;i++)
    {
        cin>>arr[i];
        if(arr[i]<0) counterN++;
        if(arr[i]==0) counterZ++;
        if(arr[i]<0 && arr[i]>maximum) maximum=arr[i];
        if(arr[i]>0 && arr[i]<minimum) minimum=arr[i];
    }
    long long int sum=0;
    //cout<<"min "<<minimum<<" max "<<maximum<<endl;
    if(counterN%2==0 || (counterN%2 != 0 && counterZ>0))
    {
        for(int i=0;i<n;i++)
        {
            if(arr[i]<0)
            {
                sum+=(-1-(arr[i]));
            }
            else if(arr[i]==0)
            {
                sum+=1;
            }
            else
            {
                sum+=(arr[i]-1);
            }
        }
        cout<<sum<<endl;
    }

    else if(counterN%2 != 0 && counterZ==0)
    {
        long diff1=1-(maximum);
        long diff2=minimum+1;
        //cout<<"dif1 "<<diff1<<" diff2 "<<diff2<<endl;
        if(diff1>diff2)
