    int zero = 0, pos = 0, neg = 0, cnt = 0;
    for (int i = 0; i < n; i++)
    {
        ll x;
        scanf("%lld", &x);

        if (x > 1)
            ans += (x - 1);

        else if (x == 0)
            zero++;

        else if(x < 0)
        {
            neg++;
            sum += abs(x);
            mx = max(mx, x);
        }
    }

    if(!(neg & 1) && neg > 0)
        ans += (sum - neg) + zero;

    else if(neg & 1)
    {
        if(zero)
            ans += ((sum + (sum - 1)) - neg) + zero;

        else
            ans += (sum - abs(mx) - (neg - 1)) + (abs(mx) + 1);
    }

    else
        ans += zero;

    printf("%lld", ans);
}
