['#include <iostream>
#include <algorithm>
#include <vector>

using namespace std;

int main()
{
	
	int n;
	int steps = 0;
	cin >> n;
	vector<int> arr;
	int negat = 0;
	int req  = 0;
	for( int i = 0; i < n; i++ )
	{
		int tmp;
		cin >> tmp;
		if( tmp < 0 )
		{
			negat++;
			if( req == 1 )
			{
				req = 0;
			}
			else
			{
				req = 1;
			}
		}
		arr.push_back(tmp);
	}

	sort(arr.begin(),arr.end());
	if( req == 1 )
	{
		if( negat < arr.size() )
		{
		steps += arr[negat] + 1;
		arr.erase(arr.begin()+negat);
		}
		else
		{
			steps += abs(arr[negat-1])+ 1;
		arr.erase(arr.begin()+negat-1);
		}
	}
	
	for( int x : arr )
	{
		if( x == 0 )
		{
			steps += 1;
			continue;
		}
		steps += abs(x) - 1;
	}
	
	cout << abs(steps);
}
