#define init ios::sync_with_stdio(0); cin.tie(NULL);cout.tie(NULL);
#define setpr(x) cout << setprecision((x))
#define PI atan(1)*4
#define fi first
#define se second
#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound
#define in insert
#define er erase
#define mk(a , b) { min((a) , (b)) , max((a) , (b)) }
#define flush cout.flush()
#define all(v) v.begin(),v.end()
#define rall(v) v.rbegin(),v.rend()
#define endc "\n"
#define MOD 998244353
 
using namespace std;
typedef long long ll;
typedef long double ld;
typedef pair<int,int> pii;
typedef pair<ll,ll> pll;
typedef pair<ld,ld> pld;
 
ll gcd(ll a, ll b){
    while(true){
        if(a>b)
            swap(a,b);
        if (a == 0) 
            return b; 
        int p = b % a  , q = a;
        a = p;
        b = q;
    }
}
 
ll powerMod(ll x,ll y){
    ll res = 1;
    x %= MOD;
    while(y > 0){
        if(y & 1)res = (res*x)%MOD;
        y = y >> 1;
        x = (x * x)%MOD;
    }
    return res%MOD;
}
 
string binary(ll s) {
    string res = "";
    while(s != 0) {
        res += (char)('0' + s % 2);
        s /= 2;
    }
    reverse(res.begin() , res.end());
    return res;
}


//  =========     /\       /|    |====/|
//      |        /  \       |    |   / |
//      |       /____\      |    |  /  |
//      |      /      \     |    | /   |
//  ========= /        \  =====  |/====|  
//  code

int main(){
    init;
    
    int n,i,j,l,p,m;
    ll k;
    cin >> n;
    vector<pii> edges;
    int v[n][61];
    int cnt[64] = {0};
    vector<int> mp[61];

    for(i = 0; i < n; i++){
        cin >> k;
        for(j = 0; j < 61; j++){
            v[i][j] = k % 2;
            k /= 2LL;
        }
    }

    for(i = 0; i < n; i++){
        for(j = 0; j < 61; j++){
            cnt[j] += v[i][j];
        }
    }

    for(i = 0; i < 64; i++){
        if(cnt[i] >= 3){
            cout << 3 << endc;
            return 0;
        }
    }
    
    for(i = 0; i < n; i++){
        for(j = 0; j < 61; j++){
            if(cnt[j] <= 1)continue;
            if(v[i][j]){
                mp[j].pb(i);
            }
        }
    }

    set<int> ss;
    map<int , int> ord;
    for(i = 0; i < 61; i++){
        if(mp[i].size() == 2){
            edges.pb({mp[i][0] , mp[i][1]});
            ss.in(mp[i][0]);
            ss.in(mp[i][1]);
        }
    }

    n = (int)ss.size();
    vector< vector<int> > gr(n);
    i = 0;
    for(auto j : ss){
        ord[j] = i++;
    }

    for(auto j : ss){
        for(auto pp : edges){
            if(j == pp.fi){
                gr[ord[j]].pb(ord[pp.se]);
            }
            if(j == pp.se){
                gr[ord[j]].pb(ord[pp.fi]);
            }
        }
    }


    int ans = INT_MAX; 
  
    // For all vertices 
    for (int i = 0; i < n; i++) { 
  
        // Make distance maximum 
        vector<int> dist(n, (int)(1e9)); 
  
        // Take a imaginary parent 
        vector<int> par(n, -1); 
  
        // Distance of source to source is 0 
        dist[i] = 0; 
        list<int> q; 
  
        // Push the source element 
        q.push_back(i); 
  
        // Continue until queue is not empty 
        while (!q.empty()) { 
  
            // Take the first element 
            int x = q.front(); 
            q.pop_front(); 
  
            // Traverse for all it's childs 
            for (int child : gr[x]) { 
  
                // If it is not visited yet 
                if (dist[child] == (int)(1e9)) { 
  
                    // Increase distance by 1 
                    dist[child] = 1 + dist[x]; 
  
                    // Change parent 
                    par[child] = x; 
  
                    // Push into the queue 
                    q.push_back(child); 
                } 
  
                // If it is already visited 
                else if (par[x] != child and par[child] != x) 
                    ans = min(ans, dist[x] + dist[child] + 1); 
            } 
        } 
    } 
  
    // If graph contains no cycle 
    if (ans == INT_MAX) 
        cout <<  -1; 
  
    // If graph contains cycle 
    else
        cout << ans; 
 

    return 0;
}
