        int n = sc.nextInt();
        int[] arr = new int[n];
        int cost = 0;
        int product = 1;
        int countzero = 0;
        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }

        for (int i = 0; i < n; i++) {
            if (arr[i] >= 1) {
                cost += arr[i] - 1;
                arr[i] = 1;
                product *= arr[i];
            } else if (arr[i] <= -1) {
                cost = cost - 1 - arr[i];
                arr[i] = -1;
                product *= arr[i];
            } else if (arr[i] == 0) {
                cost++;
                countzero++;
            }

        }
        if (countzero != 0) {
            System.out.println(cost);
        } else if (countzero == 0 && product == 1) {
            System.out.println(cost);
        } else {
            System.out.println(cost + 2);
        }

    }
}
