['#include <bits/stdc++.h>
#define ll long long int
#define f(i,n) for(ll i=0;i<n;i++)
#define rf(i,n) for(ll i=n;i>=0;i--)
#define endl '\n'
#define pub push_back
#define every(it,v) for(auto it:v)
#define vf v[i].first
#define vs v[i].second
#define mp make_pair
#define z 1000000007   
using namespace std;
ll powMod(ll x,ll y){ll p=1; while(y){if(y%2){p=(p*x)%z;} y/=2; x=(x*x)%z;} return p;}
ll invMod(ll x){return powMod(x,z-2);}
ll gcd(ll a, ll b) {return b == 0 ? a : gcd(b, a % b);}
const ll N = 1000;
vector<ll> edge[N]; 
ll visited[N];
ll dist;
void dfs(ll root){

    queue<ll> q;
    q.push(root);

    while((ll)q.size()){
        ++dist;
        ll curr = q.front();
        q.pop();
        every(it,edge[curr]){
            if(it==root){
                if(dist>=3){
                    visited[root] = 1;
                    return;
                }
            }
            else if(visited[it]!=1){
                q.push(it);
                visited[it] = 1;
            }
        }
    }
}
void reset(){
    f(i,N){
        visited[i]=0;
    }
    dist = 0;
}

ll bit[60];
void solve(){
    ll n;
    cin>>n;
    vector<ll> v;

    f(i,n){
        ll x;
        cin>>x;
        if(!x)continue;
        v.push_back(x);
        f(j,60){
            bit[j] += (x>>j & 1);
            if(bit[j]==3){
                cout<<3;
                return;
            }
        }
    }

    ll m = v.size();
    // cout<<m<<endl;
    f(i,m)
        f(j,m)
            if(v[i]&v[j]!=0 && i!=j)
                edge[i].push_back(j);

    ll ans = INT_MAX;
    f(i,m){
        dfs(i);
        if(visited[i]){
            ans = min(ans,dist);
        }
        reset();
    }     
    cout<<ans;  

}

int main(){
    ios_base::sync_with_stdio(0) ;
    cin.tie(0) ; cout.tie(0) ;

    #ifndef ONLINE_JUDGE
    freopen("input.txt", "r", stdin);
    freopen("output.txt", "w", stdout);
    #else

    #endif
    solve();
    #ifndef ONLINE_JUDGE
        cout<<"\nTime Elapsed: "<<1.0*clock()/ CLOCKS_PER_SEC<<" Sec\n";
    #endif
    return 0;
}
