using namespace std;
const int N = 1e5 + 10;
int n;
int num[N];
int pos_num = 0, neg_num = 0;
int zero = 0;
int min_pos = 2e9;
long long pos_sum = 0;
long long neg_sum = 0;
long long ans = 0;

int main()
{
    ios::sync_with_stdio(false);
    cin.tie(0);

    cin >> n;
    for (int i = 0; i < n; ++i)
    {
        cin >> num[i];
        if (num[i] > 0)
        {
            pos_num++;
            pos_sum += num[i];
            min_pos = min(min_pos, num[i]);
        } 
        else if (num[i] < 0) 
        {
            neg_num++;
            neg_sum += num[i];
        }
        else zero++;
    } 
    if (neg_num & 1)
    {
        if (zero >= 1)
        {
            zero--;
            ans += abs(neg_sum) - neg_num + 1;
            ans += pos_sum - pos_num;
            ans += zero;
        }
        else
        {
            ans += abs(neg_sum) - neg_num;
            pos_sum -= min_pos;
            pos_num--;
            ans += min_pos  - 1 + 2;
            ans += pos_sum - pos_num;
        }
    }
    else
    {
        ans += zero;
        ans += abs(neg_sum) - neg_num;
        ans += pos_sum - pos_num;
    }
    cout << ans << endl;
    return 0;
}
