['#include <iostream>
#include <algorithm>
#include <vector>
#define LL long long
const LL lens = 1e3;
LL map[lens][lens],dis[lens][lens];
std::vector <long long> v;
int main()
{
    LL tot = 0;
    LL n;
    std::cin >> n;
    for(LL i = 1;i <= n;i++)
    {
        LL tmp;
        std::cin >> tmp;
        if(tmp) v.push_back(tmp),tot++;
    }

    if(tot > 200)
    {
        std::cout << 3;
        return 0;
    }

    for(LL i = 0;i < n;i++)
    {
        for(LL j = 0;j < n;j++)
        {
            if(i != j && (v[i] & v[j])) 
            {
                dis[i][j] = map[i][j] = 1;
            }
            else dis[i][j] = map[i][j] = 1e9;
        }
    }

    LL res = 1e9;
    for(LL k = 0;k < n;k++)
    {
        for(LL i = 0;i < k;i++)
        {
            for(LL j = i + 1;j < k;j++)
            {
                res = std::min(res,map[i][j] + dis[i][k] + dis[k][j]);
            }
        }
        for(LL i = 0;i < n;i++)
        {
            for(LL j = 0;j < n;j++)
            {
                map[i][j] = std::min(map[i][j],map[i][k] + map[k][j]);
            }
        }
    }
    if(res == 1e9) std::cout << -1;
    else std::cout << res;
    return 0;
}
