	public static void dfs(int start, int curr, int p, int count) {
		if(flag[curr]) return;
		if(curr!=start) flag[curr] = true;
		for(int i:adj[curr]) {
			if(i==p) continue;
			if(i==start) {
				min=Math.min(min, count);
				continue;
			}
			dfs(start, i, curr, count=count+1);
		}
	}
}

