	for (i = 0; i < n; i++)
	{
		cin >> a[i];
		if (a[i] >= 1)
		{
			c1++;
		} else
		{
			c2++;
		}
	}
	if (c2 == 0 && c1 > 0)
	{
		for (i = 0; i < n; i++)
		{
			ans += (a[i] - 1);
		}
	} else if (c1 == 0 && c2 > 0)
	{
		if (n % 2 == 0)
		{

			for (i = 0; i < n; i++)
			{
				ans += (abs(-1 - a[i]));
			}
		} else
		{
			sort(a, a + n);
			for (i = 0; i < n - 1; i++)
			{
				ans += (abs(1 - a[i]));
			}
			ans += abs(1 - a[n - 1]);
		}
	} else 
	{
		if (c2 % 2 == 0)
